import React, { Component } from "react";

class F extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    let { qas } = this.props.compprops;
    let qasHtml = [];
    for (let i in qas) {
      qasHtml.push(
        <div className="sm eesp org-bb">
          <div className="org-fr org-fjc-sb org-fai-c mf   ">
            <div className="esp">{qas[i].question}</div>
            <div>
              <i className="fa fa-plus sp"></i>
            </div>
          </div>
          <div className="esp">Send email on Contact Us section on Website</div>
        </div>
      );
    }
    return <div className="lm ">{qasHtml}</div>;
  }
}

export default F;
